import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import {
  Container,
  Card,
  CardContent,
  Typography,
  CardMedia,
  Button,
  Box,
} from "@mui/material";
import Grid2 from "@mui/material/Grid2";
import DownloadIcon from "@mui/icons-material/Download";
import axios from "axios";

function WhiteboardSelectionPage() {
  const [whiteboards, setWhiteboards] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch whiteboards from the backend
    const fetchWhiteboards = async () => {
      try {
        const response = await axios.get("http://localhost:5001/whiteboards", {
          withCredentials: true, // Make sure to send the session cookie
        });
        setWhiteboards(response.data);
      } catch (error) {
        console.error("Error fetching whiteboards:", error);
      }
    };

    fetchWhiteboards();
  }, []);

  const handleCardClick = (id) => {
    navigate(`/label/${id}`);
  };

  const handleDownloadData = () => {
    console.log("Download button clicked");
    // Add download functionality here, if necessary
  };

  return (
    <Container
      maxWidth="md"
      style={{ marginTop: "20px", position: "relative" }}
    >
      {/* Flex container to align title and button */}
      <Box
        display="flex"
        alignItems="center"
        justifyContent="space-between"
        mb={2}
      >
        <Typography variant="h4" gutterBottom>
          Select a Whiteboard
        </Typography>

        {/* Download Data Button */}
        <Button
          variant="contained"
          color="primary"
          startIcon={<DownloadIcon />}
          onClick={handleDownloadData}
        >
          Download Data
        </Button>
      </Box>

      <Grid2 container spacing={4}>
        {whiteboards.length > 0 ? (
          whiteboards.map((whiteboard) => (
            <Grid2 xs={12} sm={6} md={4} key={whiteboard.id}>
              <Card
                onClick={() => handleCardClick(whiteboard.id)}
                style={{ cursor: "pointer" }}
              >
                <CardMedia
                  component="img"
                  height="140"
                  image={whiteboard.imageUrl}
                  alt={`Whiteboard ${whiteboard.id}`}
                />
                <CardContent>
                  <Typography variant="h6">{`Whiteboard ID: ${whiteboard.id}`}</Typography>
                  <Typography
                    color={whiteboard.annotated ? "primary" : "textSecondary"}
                  >
                    {whiteboard.annotated ? "Annotated" : "Not Annotated"}
                  </Typography>
                </CardContent>
              </Card>
            </Grid2>
          ))
        ) : (
          <Typography variant="h6" color="textSecondary">
            No whiteboards available.
          </Typography>
        )}
      </Grid2>
    </Container>
  );
}

export default WhiteboardSelectionPage;
